package com.arraylistprograms;

public class Emp {
	int id;
	String name;
	public Emp() {
		// TODO Auto-generated constructor stub
	}
	public Emp(int id, String name) {
		super();
		this.id = id;
		this.name = name;
	}
	@Override
	public String toString() {
		return "Emp [id=" + id + ", name=" + name + "]";
	}
	

}
